class Solution {
    fun count(num1: String, num2: String, min_sum: Int, max_sum: Int): Int {
        val MOD = 1_000_000_007
        fun digitSum(n: String): IntArray {
            val dp = Array(n.length + 1) { IntArray(400) }
            dp[0][0] = 1
            for (i in 1..n.length) {
                val digit = n[i - 1] - '0'
                for (sum in 0 until 400) {
                    for (d in 0..9) {
                        if (sum + d < 400) {
                            dp[i][sum + d] = (dp[i][sum + d] + dp[i - 1][sum]) % MOD
                            if (d < digit) dp[i][sum + d] = (dp[i][sum + d] + if (i == 1 && d == 0) 0 else 1) % MOD
                        }
                    }
                    if (sum + digit < 400) dp[i][sum + digit] = (dp[i][sum + digit] - if (i == 1 && digit == 0) 0 else 1 + MOD) % MOD
                }
            }
            return dp[n.length]
        }

        val sum1 = digitSum((num1.toBigInteger() - "1".toBigInteger()).toString())
        val sum2 = digitSum(num2)
        var result = 0
        for (i in min_sum..max_sum) {
            result = (result + sum2[i] - sum1[i] + MOD) % MOD
        }
        return result
    }
}
